import React, { Component } from 'react';
import './index.css';

export default class Parent extends Component {
	render() {
		return (
			<div className='parent'>
				<h3>Parent组件</h3>
			</div>
		);
	}
}
class A extends Component {
	render() {
		return (
			<div>
				<h3>A组件</h3>
			</div>
		);
	}
}
class B extends Component {
	render() {
		return (
			<div>
				<h3>B组件</h3>
			</div>
		);
	}
}
